import React, { useEffect,useState } from 'react'
import {connect} from 'react-redux'
import * as actions from '../actions/dCandidate'
import { Container, Grid,Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@material-ui/core'
import DCandidateForm from './DCandidateForm'

const DCandidates = (props) => {
  
  useEffect((props)=>{
    props.fetchAllCandidates()
  },[])

 
}

const mapStateToProps = state => ({
  dCandidateList : state.dCandidate.list
})

const mapActionsToProps = {
  fetchAllCandidates : actions.fetchall
}

export default connect(mapStateToProps,mapActionsToProps) (DCandidates)
